import React from 'react'; 
import { NavLink } from 'react-router-dom';
// import web from './Images/1.svg';


const Home = () =>{
    return (
        <>
          <section id="header" className="d-flex align-items-center">
            <div className="container-fluid ">
              <div className="row">
                <div className="col-10 mx-auto">
                <div className="row">

                   <div className="col-md-6 col-lg-6 pt-lg-0 order-2 order-lg-1 d-flex justify-content-center flex-column">
                      <h1>Grow your business with <strong className="brand-name">HiteshMali</strong></h1>
                      <h2 className="my-3">We are the team of talented developer making websites</h2>
                      <div className="mt-3">
                        <NavLink to="/service" className="btn-get-started">Get Started</NavLink>
                      </div>
                   </div>
                   <div className="col-lg-6 col-md-6 order-1 order-lg-2 header-img">
                     <img src="" className="img-fluid animated" alt="img" />
                   
                   </div>
                </div>
                </div>
              </div>
            </div>

          </section>
        </>
    )
}


export default Home;
